import React from 'react';
import axios from 'axios';
import './App.css';

class App extends React.Component {

  state = {
    user: []
  }

  componentDidMount() {
    axios
      .get('https://api.github.com/users/cmruss')
      .then(response => {
        console.log(response);
        this.setState({ user: response.data.message})
      })
  }

  render(){
    return (
      <div className="App">

      </div>
    );
  }

}

export default App;
